import { ActionTypes } from '../contants/action-type';

export const setCategorys = (category) => {
    return {
        type: ActionTypes.SELECT_CATEGORY,
        payload: category,
    }
}

export const selectedCategorys = (category) => {
    return {
        type: ActionTypes.SELECT_OF_CATEGORY,
        payload: category,
    }
}

